(1, 'home', '<section class=\"hero-section d-flex align-items-center justify-content-center\"><div class=\"container text-center custom-padding\"><!-- Prima frase: bianca, minuscola, non in grassetto --><p class=\"fs-5 text-lowercase\"><br/><br/>Siamo il partner ideale per le aziende che vogliono crescere nel mondo del marketing, migliorare il ritorno sugli investimenti (ROI) e acquisire nuovi clienti in modo intelligente ed efficace.\n      </p><!-- Seconda frase: bianca, grassetto, maiuscolo, più grande --><h1 class=\"mt-4 fw-bold text-uppercase lh-sm\">\n        Unisciti a noi e trasforma il tuo approccio al marketing con la nostra tecnologia innovativa!\n      </h1><!-- Pulsante \"Acquista Adesso\" --><a href=\"#\" class=\"mt-4 btn btn-light text-dark fw-semibold text-uppercase\">\n        Acquista Adesso\n      </a></div></section><!-- MISSION SECTION --><section class=\"bg-white text-dark py-5 d-flex align-items-center justify-content-center\"><div class=\"container text-center custom-padding\"><!-- Titolo --><h2 class=\"fw-bold mb-4 fs-3\">La Nostra Mission</h2><!-- Testo di descrizione --><p class=\"fs-5 text-muted lh-lg\">\n        Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nulla quis lorem ut libero malesuada feugiat. \n        Sed porttitor lectus nibh. Curabitur aliquet quam id dui posuere blandit. Vestibulum ac diam sit amet quam \n        vehicula elementum sed sit amet dui.\n      </p></div></section><!-- SECTION: TRE RETTANGOLI NERI INLINE (utilizzando il grid system) --><section class=\"bg-white py-5\"><div class=\"container\"><div class=\"row justify-content-center gy-4\"><!-- Rettangolo 1 --><div class=\"col-md-4\"><div class=\"bg-dark text-white p-4 shadow h-100\"><h3 class=\"fs-3 fw-bold mb-3\">Automatizzazione del Marketing</h3><p>\n              Ottimizziamo la gestione delle campagne pubblicitarie, permettendo alle aziende di concentrarsi su ciò che conta davvero, \n              mentre il nostro software si occupa di raccogliere, analizzare e segmentare i dati per individuare i clienti ideali.\n            </p></div></div><!-- Rettangolo 2 --><div class=\"col-md-4\"><div class=\"bg-dark text-white p-4 shadow h-100\"><h3 class=\"fs-3 fw-bold mb-3\">Analisi dei Dati</h3><p>\n              Il nostro strumento elabora enormi quantità di dati in tempo reale, permettendo di ottenere insights utili per personalizzare e \n              perfezionare ogni campagna, così da raggiungere il target giusto con il messaggio giusto.\n            </p></div></div><!-- Rettangolo 3 --><div class=\"col-md-4\"><div class=\"bg-dark text-white p-4 shadow h-100\"><h3 class=\"fs-3 fw-bold mb-3\">Acquisizione Clienti</h3><p>\n              Semplifichiamo il processo di identificazione e acquisizione dei potenziali clienti, riducendo il rischio di dispersione e \n              massimizzando l\'efficacia delle tue azioni pubblicitarie.\n            </p></div></div></div></div></section><!-- SECTION: LA NOSTRA PIATTAFORMA --><section class=\"bg-white text-dark py-5 d-flex align-items-center justify-content-center\"><div class=\"container text-center custom-padding\"><!-- Titolo --><h2 class=\"fw-bold mb-4 fs-3\">La nostra piattaforma</h2><!-- Testo di descrizione --><p class=\"fs-5 text-muted lh-lg\">\n        Il cuore della nostra offerta è un software intelligente, progettato per semplificare e automatizzare ogni fase del processo di marketing, \n        dalla creazione della campagna alla gestione dei lead. Utilizzando algoritmi sofisticati, il nostro software individua e seleziona i potenziali clienti \n        in base a parametri specifici e dettagliati, garantendo che ogni azione sia mirata ed efficace.\n      </p></div></section><style>* { box-sizing: border-box; } body {margin: 0;}*{box-sizing:border-box;}body{margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px;}.hero-section.d-flex.align-items-center.justify-content-center{background-color:rgb(0, 0, 0);padding:50px 50px 50px 50px;}.mt-4.fw-bold.