(5, 'aboutus', '<section class=\"bg-white py-5\"><div class=\"container text-center\"><!-- Titolo grande in grassetto --><!-- Underline nera spessa --><div class=\"bg-dark mx-auto mt-2 underline\"></div></div></section><section class=\"bg-white py-5\"><div class=\"container text-center\"><!-- Titolo grande in grassetto --><h1 class=\"fw-bold text-dark fs-3\">Chi Siamo</h1><!-- Underline nera spessa --><div class=\"bg-dark mx-auto mt-2 underline\"></div></div></section><!-- SECTION: CHI SIAMO - IMMAGINE A SINISTRA, TESTO A DESTRA (FULL WIDTH) --><section class=\"bg-white py-5\"><div class=\"container\"><div class=\"row align-items-center\"><!-- Blocco Immagine (Sinistra) --><div class=\"col-md-6 custom-padding\"><img src=\"data:image/jpeg;base64,\" alt=\"Chi Siamo\" id=\"ia4ee\" class=\"img-fluid\"/></div><!-- Blocco Testo (Destra) --><div class=\"col-md-6 custom-padding\"><h2 class=\"fw-bold text-dark fs-4 mb-4\">Chi Siamo</h2><p class=\"fs-5 text-muted\">\n            Siamo un\'azienda all\'avanguardia nel settore del marketing digitale, con un obiettivo chiaro: \n            semplificare e ottimizzare il processo di acquisizione clienti e l\'elaborazione delle campagne pubblicitarie offline. \n            <br/><br/>\n            La nostra missione è rendere le strategie di marketing più efficaci, tempestive e precise, \n            grazie all\'uso di tecnologie avanzate e software innovativi.\n          </p></div></div></div></section><!-- SECTION: PERCHE\' SCEGLIERCI --><section class=\"bg-white py-5\"><div class=\"container text-center\"><!-- Titolo grande in grassetto --><h2 class=\"fw-bold text-dark fs-1 mb-4\">PERCHE’ SCEGLIERCI</h2><!-- Paragrafo descrittivo --><div class=\"p-3\"><span id=\"iu9do\">In un mondo sempre più competitivo, avere gli strumenti giusti è fondamentale per distinguersi. La nostra soluzione ti permette di:</span></div><div class=\"row text-center\"><div class=\"col-md-4\"><h4 id=\"ivw6h\">Risparmiare Tempo e Risorse:</h4><p id=\"i7hs2\">Automazione dei processi e analisi dei dati consentono di ottenere risultati concreti con il minimo sforzo.</p></div><div class=\"col-md-4\"><h4 id=\"iku8l\">Precisione e Personalizzazione:</h4><p id=\"i80jg\">Grazie alla capacità di individuare con precisione i tuoi potenziali clienti, ogni campagna sarà costruita su misura.</p></div><div class=\"col-md-4\"><h4 id=\"inq5k\">Innovazione Continua:</h4><p id=\"iacwg\">Investiamo costantemente nella ricerca e nello sviluppo per offrire sempre soluzioni all\'avanguardia che possano anticipare le tendenze del mercato.</p></div></div><hr class=\"my-4\"/></div></section><section class=\"py-5 bg-light\"><div class=\"container\"><div class=\"container text-center my-4\"><h2 class=\"fw-bold\">ALCUNI NOSTRI PARTNER</h2><div id=\"itb3l\" class=\"divider mx-auto mb-4\"></div><div id=\"partnerCarousel-2\" data-bs-ride=\"carousel\" class=\"carousel slide\"><div class=\"carousel-inner\"><div class=\"carousel-item active\"><img src=\"data:image/jpeg;base64,\" alt=\"Logo 1\" class=\"d-block mx-auto\"/></div><div class=\"carousel-item\"><img src=\"https://via.placeholder.com/300x150\" alt=\"Logo 2\" class=\"d-block mx-auto\"/></div><div class=\"carousel-item\"><img src=\"https://via.placeholder.com/300x150\" alt=\"Logo 3\" class=\"d-block mx-auto\"/></div><div class=\"carousel-item\"><img src=\"https://via.placeholder.com/300x150\" alt=\"Logo 4\" class=\"d-block mx-auto\"/></div><div class=\"carousel-item\"><img src=\"https://via.placeholder.com/300x150\" alt=\"Logo 5\" class=\"d-block mx-auto\"/></div><div class=\"carousel-item\"><img src=\"https://via.placeholder.com/300x150\" alt=\"Logo 6\" class=\"d-block mx-auto\"/></div><div class=\"carousel-item\"><img src=\"https://via.placeholder.com/300x150\" alt=\"Logo 7\" class=\"d-block mx-auto\"/></div></div><button type=\"button\" data-bs-target=\"#partnerCarousel\" data-bs-slide=\"prev\" class=\"carousel-control-prev\"><span aria-hidden=\"true\" class=\"carousel-control-prev-icon\"></span><span class=\"visually-hidden\">Previous</span></button><button type=\"button\" data-bs-target=\"#partnerCarousel\" data-bs-slide=\"next\" class=\"carousel-control-next\"><span aria-hidden=\"true\" class=\"carousel-control-next-icon\"></span><span class=\"visually-hidden\">Next</span></button></div></div></div></section><style>* { box-sizing: border-box; } body {margin: 0;}*{box-sizing:border-box;}body{margin-top:0px;margin-right:0px;margin-bottom:0px;margin-left:0px;}#ia4ee{width:70%;}.bg-white.py-5{padding-top:10px;padding-right:10px;padding-bottom:10px;padding-left:10px;}#iu9do{color:rgba(33, 37, 41, 0.75);font-size:20px;}#itb3l{width:50px;height:3px;background-color:red;}</style>', '2025-02-03 23:18:51', '2025-02-14 17:51:53');
